import React from 'react';
import { CardDeck, Card } from 'react-bootstrap';
import DisplayProject from './DisplayProject';

const Project = ({ projects }) => {
    console.log(projects)


    const project = projects.map( project => {
        return <Card className="text-center">
            <Card.Img variant="top" src="holder.js/100px160"/>
            <Card.Body>
                <Card.Title>Title</Card.Title>
                <Card.Subtitle className="mb-2 text-muted">Language</Card.Subtitle>
                <Card.Text>Description</Card.Text>
            </Card.Body>
            <Card.Body>
                <Card.Link href="/">Portfolio Link</Card.Link>
                <Card.Link href="/">GitHub Link</Card.Link>
            </Card.Body>
            <Card.Footer>
                <small className="text-muted">Time now - updated_at = last updated time.</small>
            </Card.Footer>
        </Card>
            // title = project.name,
            // const language= project.;
            // const description= project.;
            // const urlGitHub= project.;
            // const homepage= project.;
            // const id= project.;
            // const updated= project.;
                // console.log("project", project)

    })  
console.log(project)
    return (
        <CardDeck>
           {/* <DisplayProject />      */}
           { project }
        </CardDeck>
    )
}

export default Project;
